import React from "react";
import "./index.css";
import {add,sub,mult,divi} from "./Calculation";
var col=[{
   color:'orange ',
},{
    color:'re ',
 },{
    color:'orange ',
 },
 {
    color:'orange ',
 }
];
function App(){
    return(<>
    <ul className="rm">
        <li style={col[0]}>Sum of two no is = {add(-12,22)}</li>
        <li style={col[0]}>Sub of two no is = {sub(12,2)}</li>
        <li style={col[0]}>Mult of two no is = {mult(5,2)}</li>
        <li style={col[0]}>Div of two no is = {divi(50,5)}</li>
    </ul>
    </>)
}
export default App;
